public boolean equals(Object obj)
{
	if(this == obj)
		return true;
	if((obj == null) || (obj.getClass() != this.getClass()))
			return false;
	TermsFilter test = (TermsFilter)obj;
	return (termsList == test.termsList|| 
				 (termsList!= null && termsList.equals(test.termsList)));
}

